import React from "react";
import "./NavigationBar.css";
import PictureOfMe from "../shared/images/me.svg";
import { useHistory } from "react-router-dom";

export const NavigationBar = () => {
  const history = useHistory();

  return (
    <div className="navigationBarWrapper">
      <img className="PictureOfMe" src={PictureOfMe}></img>
      <div className="textMe">
        <h1>Mikael Karlsson</h1>
      </div>
      <button
        onClick={() => (window.location = "mailto:m.karlsson8@icloud.com")}
      >
        Contact Me
      </button>
      <button
        onClick={() => history.push("/English")}
        className="englishButton"
      >
        English
      </button>
      <button onClick={"/swedish"} className="svenskButton">
        Svenska
      </button>
      <button className="homeButton">Home</button>
    </div>
  );
};
